from random import random
from timeit import timeit

"""
2. Отсортируйте по возрастанию методом слияния одномерный вещественный массив,
заданный случайными числами на промежутке [0; 50). Выведите на экран исходный
и отсортированный массивы.

Хотя в примерах к уроку уже есть вариант реализации слияния,
попробуйте предложить другой (придумать или найти)

И попытаться сделать замеры на массивах разной длины: 10, 100, 1000, ...

Пример:
Введите число элементов: 5
Исходный - [46.11436617832828, 41.62921998361278, 18.45859540989644, 12.128870723745806, 8.025098788570562]
Отсортированный - [8.025098788570562, 12.128870723745806, 18.45859540989644, 41.62921998361278, 46.11436617832828]
"""


def merge_sort(lst):
    if len(lst) > 1:
        mid = len(lst) // 2
        left = lst[:mid]
        right = lst[mid:]

        merge_sort(left)
        merge_sort(right)
        return merge_subarray(left, right, lst)


def merge_subarray(left, right, lst):
    i, j, k = 0, 0, 0

    while i < len(left) and j < len(right):
        if left[i] < right[j]:
            lst[k] = left[i]
            i += 1
        else:
            lst[k] = right[j]
            j += 1
        k += 1
    while i < len(left):
        lst[k] = left[i]
        i += 1
        k += 1
    while j < len(right):
        lst[k] = right[j]
        j += 1
        k += 1
    return lst


def timer(func, rng):
    # usr_lst = [_ for _ in range(rng, 0, -1)]
    usr_lst = [random() * 50 for _ in range(rng)]
    return f'======>>> {func}\n' \
           f'Original list: {usr_lst}\n' \
           f'List length {rng}: {timeit("func(usr_lst)", globals=locals(), number=1000)} sec.\n' \
           f'Sorted list: {usr_lst}\n'


def main():
    return print(f'{timer(merge_sort, int(input("Enter the number of elements: ")))}')


main()

